- request:
    body: "# Copyright (c) Microsoft. All rights reserved.\r\n# Licensed under the
      MIT license.\r\n\r\nimport os\r\nimport numpy as np\r\nimport argparse\r\nimport
      tensorflow as tf\r\nfrom PIL import Image\r\nfrom azureml.core import Model\r\n\r\n\r\ndef
      init():\r\n    global g_tf_sess\r\n\r\n    parser = argparse.ArgumentParser(allow_abbrev=False,
      description=\"ParallelRunStep Agent\")\r\n    parser.add_argument(\"--model\",
      type=str, default=0)\r\n    args, _ = parser.parse_known_args()\r\n\r\n    #
      pull down model from workspace\r\n    model_path = args.model\r\n\r\n    # contruct
      graph to execute\r\n    tf.reset_default_graph()\r\n    saver = tf.train.import_meta_graph(os.path.join(model_path,
      'mnist-tf.model.meta'))\r\n    g_tf_sess = tf.Session(config=tf.ConfigProto(device_count={'GPU':
      0}))\r\n    saver.restore(g_tf_sess, os.path.join(model_path, 'mnist-tf.model'))\r\n\r\n\r\ndef
      run(mini_batch):\r\n    print(f'run method start: {__file__}, run({mini_batch})')\r\n
      \   resultList = []\r\n    in_tensor = g_tf_sess.graph.get_tensor_by_name(\"network/X:0\")\r\n
      \   output = g_tf_sess.graph.get_tensor_by_name(\"network/output/MatMul:0\")\r\n\r\n
      \   for image in mini_batch:\r\n        # prepare each image\r\n        data
      = Image.open(image)\r\n        np_im = np.array(data).reshape((1, 784))\r\n
      \       # perform inference\r\n        inference_result = output.eval(feed_dict={in_tensor:
      np_im}, session=g_tf_sess)\r\n        # find best probability, and add to result
      list\r\n        best_result = np.argmax(inference_result)\r\n        resultList.append(\"{}:
      {}\".format(os.path.basename(image), best_result))\r\n\r\n    return resultList\r\n"
